import { Card } from "react-bootstrap";
//import {Link} from 'react-router-dom'
import "./Dashboard.css";
const CardTemplate = (props) => {
  return (
    <Card className="individualCard">
      <Card.Body>
        <p className="cardTitle">{props.cardName} </p>
        <div className="image">
          <img src={props.cardIcon}></img>
        </div>

        {props.identify && (
          <div class="row">
            <div className="col left">
              <p className="Text">Open</p>
              <h4 className = "Count">72</h4>
            </div>
            <div
              style={{ textAlign: "right" }}
              className="col"
            >
              <p className="Text">Drafts</p>
              <h4 className = "Count">50</h4>
            </div>
          </div>
        )}
        {props.lastCard && (
          <div >
            <div class="col-md-6 col-lg-4">
                    <div class="p-20 dashCards helpCard text-center">
                       <h4>Need Help?</h4>
                       <p class="mt-4">
                           <span>Genesys Support</span>
                           contact@nvknurseries.com
                       </p>
                       <p class="mt-4">
                           <span>Human Resources</span>
                           contact@nvknurseries.com
                       </p>
                       <p class="mt-2">Staff Directory <a href="javascript:;">Click here</a></p>
                       <span class="editIcon"><a href=""><img src="./assets/img/edit-ic.svg" /></a></span>
                    </div>
                </div>
          </div>
        )}
      </Card.Body>
    </Card>
  );
};

export default CardTemplate;
